@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:TransactionSuccess rdf:type owl:Class .
atm:BankComputer rdf:type owl:Class .
atm:ATM rdf:type owl:Class .
atm:sendMessage rdf:type owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:ATM .

atm:TransactionSuccess rdfs:subClassOf [
    rdf:type owl:Restriction ;
    owl:onProperty atm:sendMessage ;
    owl:someValuesFrom atm:ATM
] .
